import { Box, Container, Grid, Link } from "@mui/material";
export const Footer = () => {
  <Box bgcolor="black" color="white">
    <Container maxWidth="lg">
      <Grid container spacing={5}>
        <Grid item xs={12} sm={4}>
          <Box borderBottom={1}>Help</Box>
          <Box>
            <Link color="red">Contact</Link>
          </Box>
        </Grid>
      </Grid>
    </Container>
  </Box>;
};
